Yaa Asantewaa est surtout connue pour son rôle héroïque dans la guerre du Trône d’Or. Tout au long de sa vie, elle a défendu ce qu’elle croyait être la sainteté de sa terre, de sa culture et de sa langue. 

A la mort de Nana Kwasi Afrane Okpese, en 1894, Yaa Asantewaa se sert de ses prérogatives de Reine Mère pour nommer son petit-fils Ejisuhene. Deux ans à peine et les britanniques exilent une cinquantaine de chefs parmi lesquels le roi de l’Empire Ashanti, Prempeh I, et le nouvel Ejisuhene. Yaa Asantewaa devient alors régente d’Ejisu.

Pour briser la résistance de l’Empire Ashanti, le gouverneur général britannique Frederick Hodgson exige qu’on lui remette le « tabouret doré », symbole de la nation. Cette exigence pousse les membres restants du gouvernement à se réunir secrètement pour envisager le retour du roi.

Yaa Asantewaa prend donc la tête du mouvement de révolte de l’Empire Ashanti de 1900. Rapidement, la rébellion assiège le fort de Kumasi, où les Britanniques se sont réfugiés. Après plusieurs mois de siège, le gouverneur-général britannique envoie 1 400 hommes pour écraser la révolte. Dans la bataille, Yaa Asantewaa et quinze de ses conseillers sont capturés et exilés aux Seychelles. Le 1er janvier 1902, l’Empire Ashanti devient un protectorat de la couronne britannique.
